import React from "react";
import './style/main.css';


export default function Popup (p) {
    return (p.trigger) ? (
      <div class="delete-blk">
        {p.children}
        <button type="submit" className="delete-button">
            Xoa
        </button>
      </div>
    ) : ""
}
